import "./reserveTutorscr.css"


import { useState, useEffect } from "react";
const ReserveTutorPage = () => {
    const [users, setUsers] = useState([])

    const fetchUserData = () => {
      fetch("https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/show/reservations")
        .then(response => {
          return response.json()
        })
        .then(data => {
          setUsers(data)
        })
    }

    useEffect(() => {
      fetchUserData()
    }, [])

    return (
      <div>
        {users.length > 0 && (
          <ul>
            {users.map(user => (
              <li key={user.id}>{user.name}</li>
            ))}
          </ul>
        )}
      </div>
    );
  }

export default ReserveTutorPage;
